  ngAfterViewInit() {
    this.initControls.initialize();
    this.current_KRUK = KRUK;
  }

  updateTable() : void {
    if (this.notes.filter(x => !x.value).length != this.notes.length) {
      this.current_KRUK = KRUK.filter(item => this.notes.filter(x => x.value).map(note => note.name.toUpperCase()).includes(item.pitch.toUpperCase()));
    } else {
      this.current_KRUK = KRUK;
    }

    if (this.name.length > 2) {
      this.current_KRUK = this.current_KRUK.filter(item => item.name.toUpperCase().indexOf(this.name.toUpperCase()) > -1);
    }

    if (this.sounds > 0 && this.sounds < 20) {
      this.current_KRUK = this.current_KRUK.filter(item => item.sounds == this.sounds);
    }

    if (this.features) {
      this.current_KRUK = this.current_KRUK.filter(item => item.opts.includes( this.features ));
    } else {}
  }

  resetSearch() {
    this.notes.forEach(v => v.value = false);
    this.name = "";
    this.sounds = null;
    this.opts.map(o => o.value=false);
    this.features = null;
    this.updateTable();
  }

  addValue(value) {
    this.initControls.getEditor()('selection.restore');
    this.initControls.getEditor()('html.insert', "<span class='kalashnikov'>"+value+"</span>");
    this.initControls.getEditor()('commands.clearFormatting');
    this.initControls.getEditor()('selection.save');
  }

  getCookie(key: string)  {
		//return this.localStorageService.get(key);
	}
	
	putCookie(key: string, value: string){
		//return this.localStorageService.set(key, value);
	}

  save() {
    this.putCookie("kruk", JSON.stringify(KRUK));
  }

  initialize(initControls) {
    this.initControls = initControls;
  }

  buildArr(theArr) {
    let step = 10;
    var arrOfarr = [];
    for(var i = 0; i < theArr.length ; i+=step) {
        var row = [];
        for(var x = 0; x < step; x++) {
          var value = theArr[i + x];
            if (!value) {
                break;
            }
            row.push(value);
        }
        arrOfarr.push(row);
    }
    return arrOfarr;
  }

